import * as React from 'react';

import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';
import FilterListIcon from '@mui/icons-material/FilterList';
import Container from '@mui/material/Container';
import CategoryIcon from '@mui/icons-material/Category';
import CurrencyLiraIcon from '@mui/icons-material/CurrencyLira';
import ViewListIcon from '@mui/icons-material/ViewList';
import StoreIcon from '@mui/icons-material/Store';
export default function FilterResult() {
    const [value, setValue] = React.useState(0);

    const handleChange = (event, newValue) => {
        setValue(newValue);
    };

    return (
        <Container>
            <Tabs value={value} onChange={handleChange} centered variant="scrollable" scrollButtons="auto" sx={{paddingBottom:'10px'}}>
            <Tab icon={<ViewListIcon />} label="(200)"/>
                <Tab icon={<CategoryIcon />}/>
                <Tab icon={<CurrencyLiraIcon />}/>
                <Tab icon={<StoreIcon />}/>
                <Tab icon={<FilterListIcon />}/>
            </Tabs>
        </Container>
    );
}
